import React from 'react';

const Home = ({ source }) => {

    if (!source) {
        return <div>Loading...</div>;
    }

    const src = source;
    return (
        <div className="home-wrapper">
            <iframe src={src}></iframe>
        </div>
    );
};

export default Home;
